                                                        ,noofpersons
													from receptionmanualbookings_t;   
		DECLARE CONTINUE HANDLER 
		FOR NOT FOUND SET v_finished = 1;

		/*
		Cursor to loop through the booking seed data
		and iterate through each booking details
		*/
        
		SET v_bkngid = "@";
        SET v_debug = 1;
        truncate logtable;

        OPEN counterBookingData;
			getbookingdata: LOOP
				/*FETCH counterBookingData INTO 
												v_sl_no
                                                , v_idOrder
                                                , v_idReceipt
												, v_Mobile
												, v_Phone
												, v_FirstName
												, v_LastName
												, v_Address1
												, v_Address2
												, v_postcode
												, v_City	
												, v_State	
												, v_date_from
												, v_date_to	
												, v_check_in
												, v_check_out
												, v_order_status
												, v_payment_status
												, v_payment_type	
												, v_hotel_name		
												, v_room_type		
												, v_advance_paid	
												, v_room_num;*/
				FETCH counterBookingData INTO 
												v_idReceipt
												, v_Mobile
												, v_FirstName
												, v_postcode
												, v_City	
												, v_State	
												, v_date_check_in
												, v_date_check_out
												, v_time_check_in
												, v_time_check_out
												, v_hotel_name		
												, v_advance_paid
												, v_amount_paid	
												, v_room_num
                                                , v_noofpersons;

				IF v_finished = 1 THEN 
						LEAVE getbookingdata;
				END IF;
                    
				-- ---------------------------------------------------
				-- Fetch the following unique Keys for creating order
				--      Order ID 
				--      SECURE_KEY
				--		customer id
				-- ---------------------------------------------------
                    
                SET v_bkngid = genOrderID(v_idReceipt);
                SET v_secure_key =  getSecureKey();
               	SET v_logmsg = concat ( v_idReceipt
												, v_Mobile
												, v_FirstName
												, v_postcode
												, v_City	
												, v_State	
												, v_date_check_in
												, v_date_check_out
												, v_time_check_in
												, v_time_check_out
												, v_hotel_name		
												, v_advance_paid
												, v_amount_paid	
												, " room ", v_room_num
                                                , v_bkngid
                                                );
				set v_msgtype = "I";
                set v_prstep = "processing cust: " ;
                CALL logmsg(v_debug,v_msgtype,v_prstep,v_logmsg,v_secure_key); 
				
                /*
					Customer details are mandatory to create orderr.
                    If customer does not exist create customer or update 
                    customer
                */
                CALL createDevotee(v_firstname     
										, v_lastname    
										, v_email       
										, v_birthday    
										, v_secure_Key
                                        , v_postcode 
										, v_city      
                                        , v_Mobile 
                                        , v_debug
										, v_id_customer
                                        , v_id_address
                                        , v_logmsg);
                                        

                /*
					Check If the room is already occupied 
                */

                CALL getHotelOccDtls (v_hotel_name 		
								, v_room_num 
                                , v_debug
                                , v_secure_Key
                                , v_isOccupied
                                , v_id_product
                                , v_id_hotel
                                , v_logmsg);
				
				set v_msgtype = "I";
                set v_prstep = "processing room details: " ;
                CALL logmsg(v_debug,v_msgtype,v_prstep,v_logmsg,v_secure_key);                
                
                IF (v_isOccupied) THEN
					/* 
						Room is  occupied 
						Check if the room is alloted to same customer or different customer
						If same customer then update order log as booking entry exists
						else raise an exception
					*/
					CALL skipCustomerBkng (    
											v_idReceipt			
											, v_firstname    
											, v_mobile 		
											, v_date_check_in 
											, v_room_num		
											, v_time_check_in  
											, v_reason	 
                                            , v_secure_key
											, v_debug        	
											, v_logmsg 			
											);
				 else
					/*
						create order
                    */
                    CALL createOrder(  v_id_customer			
									,  v_id_address			
									,  v_id_product			
									,  v_id_hotel			
									,  v_isOccupied			
									,  v_room_num 	
                                    ,  v_noofpersons
									,  v_secure_key   
                                    ,  v_bkngid 
									,  v_debug        		 
									,  v_id_cart				 
									,  v_logmsg 				 				
								);
				
                END IF;
				set v_msgtype = "I";
                set v_prstep = "processed booking order " ;
                CALL logmsg(v_debug,v_msgtype,v_prstep,v_logmsg,v_secure_key); 
				
                -- Following is the only commit after all transcations are done
                commit;   
            END LOOP getbookingdata;
		CLOSE counterBookingData;
	END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `getHotelOccDtls` (IN `v_hotel_name` VARCHAR(255), IN `v_room` VARCHAR(50), IN `v_debug` INT, IN `v_secure_key` VARCHAR(32), OUT `v_isOccupied` INT, OUT `v_id_product` INT, OUT `v_id_hotel` INT, OUT `v_logmsg` TEXT)  BEGIN
		/*For logging*/
		DECLARE v_msgtype 							varchar(20) 	DEFAULT "-1";  					-- log mesage type e.g E means error, I means info
		DECLARE v_prstep 							varchar(45) 	DEFAULT "-1"; 					-- step e.g. crcustomer, delete order etc
		DECLARE v_errno                             INT 			DEFAULT 0; 
		DECLARE v_sqlstate                          VARCHAR (100);
        
		/* 
			Get the hotel id and product id from the ps_htl_room_type_v for the chosen hotel and category
			e.g. Bharati Tirtha Kripa, 2 Bed Indian BV 
		*/
		select id_product
				, id_hotel
		into
			v_id_product
			, v_id_hotel
		from ps_htl_room_type_v
		where
			 hotel_name = v_hotel_name
			 and room_num = v_room;

		/*
			Check if the room is already occupied / allotted
		*/
		SET v_isOccupied = -1;
		
		select
			   count(*)
		into   v_isOccupied
		from 
			   ps_htl_booking_detail
		where   
			   id_status IN (1,3)
			   and id_room = v_room
			   and id_hotel = v_id_hotel;
			   
		set v_logmsg = concat ("hotel ", v_hotel_name
								, " ID: ", v_id_hotel
								, " room : ", v_room
								, " room product id: ", v_id_product
								, " occ. status : ", v_isOccupied
							  );
		
END$$

