END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `logmsg` (IN `v_debug` INT, IN `v_msgtype` VARCHAR(20), IN `v_prstep` VARCHAR(45), IN `v_logmsg` TEXT, IN `v_securekey` VARCHAR(100))  BEGIN
	if v_debug >=1 then
							msgtype
							, prstep
                            , logmsg
