CREATE DEFINER=`root`@`localhost` PROCEDURE `skipCustomerBkng` (IN `v_idReceipt` VARCHAR(100), IN `v_firstname` VARCHAR(32), IN `v_mobile` VARCHAR(32), IN `v_date_check_in` DATE, IN `v_room_num` VARCHAR(50), IN `v_time_check_in` TIME, IN `v_reason` TEXT, IN `v_secure_key` VARCHAR(100), IN `v_debug` INT, OUT `v_logmsg` TEXT)  BEGIN
		/*For logging*/
		DECLARE v_msgtype 							varchar(20) DEFAULT "-1";  					-- log mesage type e.g E means error, I means info
		DECLARE v_prstep 							varchar(45) DEFAULT "-1"; 					-- step e.g. crcustomer, delete order etc
		DECLARE v_errno                             INT DEFAULT 0; 
		DECLARE v_sqlstate                          VARCHAR (100);
		
        DECLARE EXIT HANDLER FOR SQLEXCEPTION       SELECT 'SQLException encountered';
		BEGIN
			GET DIAGNOSTICS CONDITION 1 v_sqlstate = RETURNED_SQLSTATE, 
			v_errno = MYSQL_ERRNO, v_logmsg = MESSAGE_TEXT;
			SET v_logmsg = CONCAT("ERROR ", v_errno, " (", v_sqlstate, "): ", v_logmsg);
        
						idReceipt
						,FirstName
						,Mobile
						,date_check_in
						,room_num
						,time_check_in
						,reason)
						VALUES
						(
                        v_idReceipt
						,v_FirstName
						,v_Mobile
						,v_date_check_in
						,v_room_num
						,v_time_check_in
						,v_reason
                        );
            SET v_prstep = "customer booking missed logging ";
			set v_msgtype = "I";            
			SET v_logmsg = concat("Skipped Booking Entry For : ", v_firstname, " @ room : ", v_room_num);
            CALL logmsg(v_debug,v_msgtype,v_prstep,v_logmsg,v_secure_key);
        END;
END$$

