CREATE DEFINER=`root`@`localhost` FUNCTION `genOrderID` (`v_idreceipt` VARCHAR(100)) RETURNS VARCHAR(9) CHARSET utf8 BEGIN
    DECLARE v_uid			        VARCHAR(15) DEFAULT NULL;
	DECLARE v_bkngid                VARCHAR(100) DEFAULT NULL;
		
	/*
		If Receipt id is not available set auto generated value for the order
		Use UUID to generate a new unique order ID
	*/

	SET v_uid = left(UUID(),9);
	IF (v_idreceipt IS NOT NULL) THEN
		SET v_bkngid = CONCAT(v_idreceipt,'::', left(v_uid,4));
	ELSE
		SET v_idreceipt = left(UUID(),9);
		SET v_bkngid = v_idreceipt;
	END IF;

RETURN v_bkngid;
END$$

CREATE DEFINER=`root`@`localhost` FUNCTION `getSecureKey` () RETURNS VARCHAR(100) CHARSET utf8 BEGIN
 DECLARE a_secureKey VARCHAR(100) default null;
 select md5(rand()) into a_secureKey; 
RETURN a_secureKey;
END$$

CREATE DEFINER=`root`@`localhost` FUNCTION `isCustExist` (`v_fname` VARCHAR(100), `v_mobile` VARCHAR(32)) RETURNS INT(11) BEGIN
	DECLARE v_custId 	INT DEFAULT -1;
    DECLARE v_count 	INT DEFAULT 0;
    
    /*
		Get the customer details if existing in the address table
        If more than one entry for the customer is found return the cpunt
        if one entry is found for the customer return customer id
        if no entry is found for the customer return 0
    */
    
    IF (v_mobile is not null)  THEN
		SELECT count(*) INTO v_count FROM ps_address a
										, ps_customer b 
									where a.phone_mobile = v_mobile
                                    and a.id_customer = b.id_customer
                                    and upper(b.firstname) = upper (v_fname);
	END IF;
    
    IF v_count = 1 THEN
		-- SET v_custId = 1;
       	SELECT id_customer INTO v_custID FROM ps_address
											where phone_mobile = v_mobile;	
	ELSEIF v_count > 1 THEN
    	SET v_custId = -2;
	ELSE
		SET v_custId = 0;
    END IF;
    
	RETURN v_custId;
END$$

CREATE DEFINER=`root`@`localhost` FUNCTION `isRoomAvailable` (`v_hotel_name` VARCHAR(255), `v_room` VARCHAR(50)) RETURNS INT(11) BEGIN

	DECLARE v_isOccupied 		INT DEFAULT 0;
    DECLARE v_id_product 		INT DEFAULT 0;
    DECLARE v_id_hotel 			INT DEFAULT 0;
    
    /* 
		Get the hotel id and product id from the ps_htl_room_type_v for the chosen hotel and category
		e.g. Bharati Tirtha Kripa, 2 Bed Indian BV 
	*/
	select id_product
			, id_hotel
	into
		v_id_product,
		v_id_hotel
	from ps_htl_room_type_v
	where
		 hotel_name = v_hotel_name
		 and room_num = v_room;

	/*
		Check if the room is already occupied / allotted
	*/
	SET v_isOccupied = -1;
    
	select
		   count(*)
	into   v_isOccupied
	from 
		   ps_htl_booking_detail
	where   
		   id_status IN (1,3)
		   and id_room = v_room
		   and id_hotel = v_id_hotel;

	RETURN v_isOccupied;
END$$

